outputs.output_descr:
1. MDGs mainstreamed/aligned into National Development Plans;
2. Community based MDG Report and Human Development Profiles produced for all village(s), atolls and Outer Islands that already have Village Sustainable Development Plans;
3. An Analytical Paper produced highlighting key findings from the quadruple crisis analysis and an Action Plan prepared providing practical options for  village(s), atolls and Outer Islands to address the quadruplet effect of climate change, financial crisis, food security and energy crisis.
